import { useState } from "react";
import styles from "../loginAndSignin.module.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebook, faGoogle } from "@fortawesome/free-brands-svg-icons";
import classNames from "classnames/bind";
import Image from '../../../assets/images'
const cx = classNames.bind(styles);

function LogIn() {
        const [onLogin,setOnLogin] = useState()

        const handleOnClickLogin = () =>{
            setOnLogin();
        }
   

    return (
        <div className={cx("login-container")}>
            <h2>Đăng nhập</h2>
            <form className={cx('')}>
              <div >
                <img src={Image.logo} alt="Shop Logo"  className={cx('Logo')}/>
              </div>
              <div className={cx('btn-login')} 
                 onClick={()=> handleOnClickLogin()}>
                <img src={Image.facebookIcon} alt="Logo"  width={20}/> 
                <strong>  Đăng nhập bằng Facebook</strong>
            
              </div>
              <div className={cx('btn-login')} 
                onClick={()=> handleOnClickLogin()}>
              <img src={Image.googleIcon} alt="Google Logo"  width={20}/> 
             
              <strong> Đăng nhập bằng Google</strong>
              </div>
            </form>
        </div>
    );
}

export default LogIn;
